import React from "react";
// import ProgressBar from "react-bootstrap/ProgressBar";

import Titles from "./games";

const Progress = () => (
  <>
    {Titles.map((game, key) => (
      <div>
        <Link to={game.name}>{game.name}</Link>
      </div>
    ))}
  </>
);

export default Progress;
